import { albumImageStyle } from "../Styles/StyleFunctions";

export default function AlbumComponent ({place}) {
    return (
        <div>
            <h1>{place}</h1>
        <img 
        src = "https://upload.wikimedia.org/wikipedia/en/e/e6/The_Diary_Of_Alicia_Keys_album_cover.jpg"
        style = {albumImageStyle()}
        >
        </img>
        <div>The Diary of Alicia Keys</div>
        <div>Alicia Keys</div>
        <div>Magnifying Glass Here</div>
        </div>
    )
}
